import React from 'react'
import st from './cards.module.css';

function Cards({ data }, {filter}) {

  return (
    <main>
      {data.map( (elem, filter) => (
       filter.toLowerCase() === elem.title ? console.log(1) : console.log(0)
      )) }
      {data.map((elem, index) => (

              <div key={index} className={st.card}>
                  <div className={st.emoji}>{elem.symbol}</div>
          <h3 >{elem.title}</h3>
          <p>{elem.keywords}</p>
        </div>
      ))}
    </main>
  )
}

export default Cards
